import React, { useEffect, useState } from 'react';
import './App.css';

import scale from './assets/radaltback.png';
import cover from './assets/radaltcover.png';
import needle from './assets/radaltneedle.png';
import bugImg from './assets/bug.png';
import flagImg from './assets/radaltflag.png';

function App() {
  defaultValue: 50
  minValue: 0
  maxValue: 100
  easeDuration: 500

  function limitValue(value, minValue, maxValue) {
    let currentValue = 0
    if (!isNaN(value)) {
      currentValue = parseInt(value)
    }
    return Math.min(Math.max(currentValue, minValue), maxValue);
  }

  return (
    <div>
      <h1>Radar Altimeter</h1>
      <div class='parent'>
        <img class='scale' src={scale}></img>
        <img class='flagImg' src={flagImg}></img>
        <img class='needle' src={needle}></img>
        <img class='cover' src={cover}></img>
        <div class='light'></div>
        <img class='bugImg' src={bugImg}></img>
      </div>
      <label>
        <input type='checkbox' />
      </label>
    </div>
  );
}

export default App;
